import React from "react";

const ResumeScreen = () => {
  return (
    <div className="container">
      <div className="section-title">
        <h2>Resume</h2>
      </div>
      <div className="row">
        <div className="col-lg-6">
          <h3 className="resume-title">Summary</h3>
          .resume-item.pb-0
        </div>
        <div className="col-lg-6"></div>
      </div>
    </div>
  );
};

export default ResumeScreen;
